sys_variable_value.value:
var start = new GlideDateTime(current.start);
var end = new GlideDateTime(current.end);
var duration = GlideDateTime.subtract(start, end);
var days = parseInt(duration.getNumericValue()) / 86400 / 1000;

//gs.info('days: ' + days);
//workflow.scratchpad.waitDate = days;

var gr = new GlideRecord('x_0232_bnbnow_unavailability');
for (var i = 0; i < days; i++) {
	gr.newRecord();
	gr.setValue('listing', current.listing);
	if (i !== 0) {
		start.addDaysUTC(1);
	}
	gr.setValue('date', start.getDate());
	gr.insert();
}

